-- ----------------------------
--  Table structure for `tb_coin_summary`
-- ----------------------------
DROP TABLE IF EXISTS `tb_coin_summary`;
CREATE TABLE `tb_coin_summary` (
  `ID` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `COIN_NAME` varchar(64) CHARACTER SET utf8 NOT NULL COMMENT '币种',
  `COIN_NUM` decimal(16,8) NOT NULL COMMENT '总数量',
  `TOTAL_COST` decimal(16,8) NOT NULL COMMENT '总费用（包含所有其他费用）',
  `SERVICE_CHARGE` decimal(16,8) NOT NULL COMMENT '手续费',
  `MONETARY_UNIT` varchar(16) CHARACTER SET utf8 NOT NULL COMMENT '货币单位（USDT）',
  `AVARANGE_PRICE` decimal(16,8) NOT NULL COMMENT '均价',
  `DEL_SETTLEMENT_PRICE` decimal(16,8) DEFAULT NULL COMMENT '结算市价',
  `DEL_EARN_RATE` decimal(5,2) DEFAULT NULL COMMENT '收益率',
  `DEL_EARN_NUM` decimal(16,8) DEFAULT NULL COMMENT '收益数',
  `DEL_SETTLEMENT_DATE` timestamp NULL DEFAULT NULL COMMENT '结算时间',
  `DEL_SETTLEMENT_VERSION` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '结算版本',
  `CREATE_DATE` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `UPDATE_DATE` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

