-- ----------------------------
--  View structure for `v_coin_total_value`
-- ----------------------------
DROP VIEW IF EXISTS `v_coin_total_value`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_coin_total_value` AS select sum((`tcp`.`coin_price` * `ti`.`buy_coin_num`)) AS `coin_value`,'ICO' AS `coin_code` from (`blockchain`.`tp_coin_price` `tcp` join `blockchain`.`tp_ico` `ti`) where (`tcp`.`coin_code` = `ti`.`buy_coin_code`) union all select (`tr`.`buy_num` * `tcp`.`coin_price`) AS `coin_value`,`tcp`.`coin_code` AS `coin_code` from (`blockchain`.`tp_coin_price` `tcp` join (select sum(`blockchain`.`tp_transaction`.`buy_num`) AS `buy_num`,`blockchain`.`tp_transaction`.`coin_code` AS `coin_code` from `blockchain`.`tp_transaction` group by `blockchain`.`tp_transaction`.`coin_code`) `tr`) where (`tcp`.`coin_code` = `tr`.`coin_code`);

